import {useState} from 'react';

function Todo(props) {
    
   const [ modalIsOpen, setModalIsOpen] = useState(false);

    function deleteHandler(props){
        setModalIsOpen(true);

    }
  
    return (
    <div className="card">
      <h2>{props.text}</h2>
      <div className="actions">
        <button onClick={deleteHandler} className="btn">delete</button>
      </div>
    </div>
  );
}

export default Todo;
